result:
.content {
    padding: 20px;
    background: white;
}

.h2 {
    font-size: 18px;
    font-weight: 400;
    line-height: 1.5;
    margin-bottom: 8px;
}

.notification-headers {
    float: right;
    padding-right: 11px;
    margin-top: 5px;
}

.notification-headers small {
    display: inline-block;
    margin-left: 10px;
    font-size: 12px;
    text-align: center;
    width: 40px;
}

.subsection-container {
    background: #fafafa;
    border: 1px solid #edeff0;
    padding: 0px;
    border-radius: 4px;
    margin-bottom: 15px;
}

.application-options {
    background: #fafafa;
    border-radius: 4px;
    margin-bottom: 0px;
    display: block;
    border: none;
    padding: 0 !important;
}

.option-item {
    display: flex;
    padding-bottom: 10px;
    border-bottom: 1px solid #dedede;
    padding: 10px;
    margin: 0 !important;
}

.option-item-info {
    flex: 1;
    margin: 0;
    padding: 0;
    border: 0;
    font-size: 100%;
    font: inherit;
    -webkit-box-sizing: border-box;
    -moz-box-sizing: border-box;
    box-sizing: border-box;
    vertical-align: baseline;
}
